 */

export default {

    props: {
        /**
         * The class that is being toggled. Defaults to the hidden attribute.
         */
        cls: Boolean,
        /**
         * Reveal item directly or with a transition.
         */
        animation: 'list',
        /**
         * Animation duration in milliseconds.
         */
        duration: Number,
